properties.description:
Proponiamo appartamento di sei locali con terrazzi e 2 box esposizione: doppia
- porta di accesso: blindata;
- serramenti esterni: in legno con doppi vetri;
- sistema di oscuramento: tapparelle avvolgibili;
- porte interne: a battente, in legno tamburato finitura naturale;
- pareti: normalmente tinteggiate, in ceramica nei bagni ed in cucina;
- pavimenti: in ceramica, in marmo o in parquet in funzione delle stanze;
- impianto citofonico: presente;
- impianto elettrico: sotto traccia;
- impianto idrico: sotto traccia;
- impianto termico: riscaldamento di tipo autonomo con caldaietta murale a gas installata in terrazzo e termosifoni;
- acqua calda sanitaria: prodotta dalla caldaietta di cui sopra;
- servizi igienici: dotato di lavello, vaso, bidet, doccia o vasca;
- impianto di condizionamen
